import React, { useState, useEffect } from 'react';
import { Container, ContainerStatus } from '../types';
import { apiService } from '../services/api';

interface ContainerListProps {
  onSelectContainer: (container: Container) => void;
  selectedContainer: Container | null;
}

const ContainerList: React.FC<ContainerListProps> = ({ 
  onSelectContainer, 
  selectedContainer 
}) => {
  const [containers, setContainers] = useState<Container[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    fetchContainers();
  }, []);

  const fetchContainers = async (): Promise<void> => {
    try {
      setLoading(true);
      const response = await apiService.getContainers();

      if (response.success && response.data) {
        setContainers(response.data);
        setError(null);
      } else {
        throw new Error(response.error || 'Failed to fetch containers');
      }
    } catch (err) {
      console.error('Failed to fetch containers:', err);
      setError(err instanceof Error ? err.message : 'Failed to fetch containers');
    } finally {
      setLoading(false);
    }
  };

  const getStatusIcon = (status: ContainerStatus): string => {
    switch (status) {
      case 'running': return '🟢';
      case 'stopped': return '🔴';
      case 'pending': return '🟡';
      default: return '⚪';
    }
  };

  const getStatusClass = (status: ContainerStatus): string => {
    switch (status) {
      case 'running': return 'status-running';
      case 'stopped': return 'status-stopped';
      case 'pending': return 'status-pending';
      default: return 'status-unknown';
    }
  };

  if (loading) {
    return (
      <div className="container-list loading">
        <div className="loading-spinner">⏳</div>
        <p>Loading containers...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="container-list error">
        <div className="error-message">
          <h3>❌ Error</h3>
          <p>{error}</p>
          <button onClick={fetchContainers} className="retry-btn">
            🔄 Retry
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="container-list">
      <div className="list-header">
        <button onClick={fetchContainers} className="refresh-btn" title="Refresh">
          🔄
        </button>
        <span className="container-count">
          {containers.length} containers
        </span>
      </div>

      <div className="containers">
        {containers.length === 0 ? (
          <div className="empty-state">
            <p>📭 No containers found</p>
          </div>
        ) : (
          containers.map((container) => (
            <div
              key={container.id}
              className={`container-item ${
                selectedContainer?.id === container.id ? 'selected' : ''
              } ${getStatusClass(container.status)}`}
              onClick={() => onSelectContainer(container)}
            >
              <div className="container-header">
                <span className="status-icon">
                  {getStatusIcon(container.status)}
                </span>
                <span className="container-name">{container.name}</span>
              </div>

              <div className="container-meta">
                <span className="container-id">{container.id}</span>
                <span className={`container-status ${container.status}`}>
                  {container.status}
                </span>
              </div>

              {Object.keys(container.labels).length > 0 && (
                <div className="container-labels">
                  {Object.entries(container.labels).slice(0, 2).map(([key, value]) => (
                    <span key={key} className="label-tag">
                      {key}: {value}
                    </span>
                  ))}
                  {Object.keys(container.labels).length > 2 && (
                    <span className="label-more">
                      +{Object.keys(container.labels).length - 2} more
                    </span>
                  )}
                </div>
              )}
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default ContainerList;
